import React, {Component} from 'react'
import classes from './Quiz.module.css'
class Quiz extends Component{
    render(){
        state ={
            quiz:[],
            text:"test"
        }
        return(
            <div className={classes.Quiz}>
                {this.state.text}
                <p>Quiz</p>
            </div>
        )
    }
}
export default Quiz;
